import React from 'react';

// Prop interfaces
interface CardProps extends React.HTMLAttributes<HTMLDivElement> { }
interface CardContentProps extends React.HTMLAttributes<HTMLDivElement> { }
interface CardHeaderProps extends React.HTMLAttributes<HTMLDivElement> {
    title: string; // Explicit type for title
}
interface CardTitleProps extends React.HTMLAttributes<HTMLDivElement> { }

export const Card = ({ children, className, ...props }: CardProps) => (
    <div className={`p-4 bg-white shadow rounded ${className}`} {...props}>{children}</div>
);

export const CardContent = ({ children, className, ...props }: CardContentProps) => {
    return <div className={`py-2 ${className}`} {...props}>{children}</div>;
};

export const CardHeader = ({ title, className, ...props }: CardHeaderProps) => (
    <h3 className={`text-lg font-bold ${className}`} {...props}>{title}</h3>
);

export const CardTitle = ({ children, className, ...props }: CardTitleProps) => (
    <div className={`text-xl font-semibold ${className}`} {...props}>{children}</div>
);
